import React from 'react';
import './channels.css';
import { Link } from 'react-router-dom';

function Channels () {

  return (
    <div className='channels-page'>
      <div className='channels-header'>
        <h2>Media Reward Channels</h2>
      </div>

      <div className='media-channels-container'>
        <Link to='/channels/instagram'>
          <img src='https://miracomohacerlo.com/wp-content/uploads/2017/07/1-7.jpg' alt='Instagram'></img>
        </Link>
      </div>

      <div className='database-header' >
        <h4>Database Connection</h4>
      </div>
    </div>
  )
}

export default Channels;
